  `custom` int(11) unsigned NOT NULL,
  `memo` varchar(50) DEFAULT NULL,
  `num_cart_items` smallint(6) NOT NULL DEFAULT '0',
  `payment_status` set('Completed','Pending','Failed','Denied','Canceled_Reversal','Refunded','Reversed') NOT NULL DEFAULT 'Failed',
  `payment_gross` decimal(10,2) NOT NULL DEFAULT '0.00',
  `payment_fee` decimal(10,2) NOT NULL DEFAULT '0.00',
  `mc_gross` decimal(10,2) NOT NULL DEFAULT '0.00',
  `mc_fee` decimal(10,2) NOT NULL DEFAULT '0.00',
  `settle_amount` float NOT NULL DEFAULT '0',
  `mc_currency` varchar(20) NOT NULL DEFAULT 'USD',
  `settle_currency` varchar(20) NOT NULL DEFAULT 'USD',
  `exchange_rate` varchar(125) DEFAULT NULL,
  `pending_reason` set('echeck','intl','verify','address','upgrade','unilateral','other','multi_currency') NOT NULL DEFAULT 'other',
  `reason_code` set('buyer_complaint','chargeback','guarantee','refund','other') NOT NULL DEFAULT 'other',
  `payment_date` datetime NOT NULL,
  `txn_id` varchar(20) NOT NULL DEFAULT '0',
  `parent_txn_id` varchar(20) NOT NULL DEFAULT '0',
  `payer_email` varchar(125) DEFAULT NULL,
  `payer_id` varchar(125) DEFAULT NULL,
  `payer_business_name` varchar(255) DEFAULT NULL,
  `payer_status` set('verified','unverified','intl_verified') NOT NULL DEFAULT 'unverified',
  `txn_type` set('web_accept','cart','send_money','subscr_signup','subscr_cancel','subscr_failed','subscr_payment','subscr_eot') NOT NULL DEFAULT 'web_accept',
  `payment_type` set('echeck','instant') NOT NULL DEFAULT 'instant',
  `first_name` varchar(35) DEFAULT NULL,
  `last_name` varchar(60) DEFAULT NULL,
  `address_name` varchar(255) DEFAULT NULL,
  `address_city` varchar(60) DEFAULT NULL,
  `address_street` varchar(60) DEFAULT NULL,
  `address_state` varchar(60) DEFAULT NULL,
  `address_zip` varchar(15) DEFAULT NULL,
  `address_country` varchar(60) DEFAULT NULL,
  `address_status` set('confirmed','unconfirmed') NOT NULL DEFAULT 'unconfirmed',
  `notify_version` varchar(6) DEFAULT NULL,
  `verify_sign` varchar(255) DEFAULT NULL,
  `datecreated` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `startdate` date NOT NULL,
  `enddate` date NOT NULL,
  PRIMARY KEY (`id`),
  KEY `payment_txn_type` (`txn_type`),
  KEY `payment_status` (`payment_status`),
  KEY `payment_pending_reason` (`pending_reason`),
  KEY `payment_receiver_email` (`receiver_email`),
  KEY `fk_payment_userid` (`custom`),
  CONSTRAINT `fk_payment_userid` FOREIGN KEY (`custom`) REFERENCES `useraccount` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


