INSERT INTO `lookupquery` (`id`, `name`, `description`, `querystring`) VALUES
(1,	'ALL_USERS',	'Returns the list of all Users in the system',	'SELECT u.id as optionvalue, concat(u.firstname,\' \',u.surname) as optiontext FROM useraccount u ORDER BY optiontext'),
(2,	'ALL_ACL_GROUPS',	'All defined ACL groups',	'SELECT id as optionvalue, name as optiontext FROM aclgroup'),
(3,	'ALL_RESOURCES',	'The resources that are secured within the application',	'SELECT r.name AS optiontext, r.id AS optionvalue FROM aclresource AS r ORDER BY optiontext'),
(4,	'ALL_VARIABLE_SECTIONS',	'All the variable sections in the application configuration',	'SELECT section as optiontext, section as optionvalue FROM appconfig GROUP BY section ORDER BY section'),
(5,	'ALL_CLANS',	'All clans',	'SELECT id as optionvalue, shortname as optiontext FROM organisation where type = 1 ORDER BY optiontext'),
(6,	'ALL_MASIGA',	'All clan divisions',	'SELECT id as optionvalue, shortname as optiontext FROM organisation where type = 2 ORDER BY optiontext'),
(7,	'ALL_MITUBA',	'All sub clan divisions',	'SELECT id as optionvalue, shortname as optiontext FROM organisation where type = 3 ORDER BY optiontext'),
(8,	'ALL_NYIRIRI',	'All lineages',	'SELECT id as optionvalue, shortname as optiontext FROM organisation where type = 4 ORDER BY optiontext'),
(9,	'ALL_SSAZAS',	'All ssazas',	'SELECT id as optionvalue, name as optiontext FROM place where type = 1 ORDER BY optiontext'),
(10,	'ALL_PLACES',	'All places',	'SELECT id as optionvalue, name as optiontext FROM place where type = 2 ORDER BY optiontext'),
(11,	'ALL_VILLAGES',	'All villages',	'SELECT id as optionvalue, name as optiontext FROM place where type = 4 ORDER BY optiontext'),
(12,	'ALL_PARISHES',	'All parishes',	'SELECT id as optionvalue, name as optiontext FROM place where type = 3 ORDER BY optiontext');
