INSERT INTO `news` (`id`, `headline`, `datepublished`, `author`, `source`, `country`, `summary`, `newsdetail`, `newslink`, `newsimage`, `keywords`, `publish`, `featured`, `datecreated`) VALUES
(1,	'New GandaAncestry.com Launched',	'2012-11-19',	NULL,	NULL,	NULL,	'<p>GandaAncestry today introduced a new version of the genealogical website www.gandaancestry.com, which works as an online social network. The introduction was timed to commemorate the birthday of Ssekabaka Walugembe Muteesa II of Buganda, who was born on November 19, 1924 and was assassinated on November 21, 1969.',	'<p>GandaAncestry today introduced a new version of the genealogical website www.gandaancestry.com, which works as an online social network. The introduction was timed to commemorate the birthday of Ssekabaka Walugembe Muteesa II of Buganda, who was born on November 19, 1924 and was assassinated on November 21, 1969.</p>\r\n								<p>The new GandaAncestry will be available for use by all people who have at least an ancestor who belonged to one of the Baganda clans.  The service will be generally  free but users who wish to enjoy certain premium privileges, such as extra large storage quotas will be charged a small monthly membership fee.</p>\r\n								<p>According to A. Nakazzi, the chief executive at GandaAncestry, www.gandaancestry.com starts with a limited number of features but will expand to become \"An online ecosystem where people with Baganda ancestry and others interact with Baganda institutions, each other and various resources to enrich their life experiences.\"</p>\r\n								<p>A limited number of users (beta users) have been recruited to use the system for the next weeks and provide feedback until mid-December, when it will become available to the general public.</p>\r\n								<p>For Additional info contact: Send email to info@gandaancestry.com</p> ',	'',	'uploads/news/launch.png',	NULL,	1,	1,	'2012-12-08 01:02:17'),
