(123,	NULL,	4,	107,	NULL,	1,	'Henry',	'Kakumba',	'Kakumba',	'',	'',	'Henry Kakumba (Kakumba)',	'',	'HK',	NULL,	1,	2,	NULL,	NULL,	0,	0,	NULL,	NULL,	NULL,	47,	NULL,	NULL,	NULL,	NULL,	NULL,	'Henry Hunt Kakumba was born at Bulemezi in Kampala Uganda in 1892 to Mr. Balinabe Kiwanuka Kakumba and Mrs. Josephine Mulowoza. He was the third born in a family of eight. He is of the Nyoni eya Nakasige clan.\r\n\r\nHe attended Nsambya Primary School and then later Mengo Primary school where he successfully completed his Primary 7. Unfortunately, He was not able to take up the place he was offered in Budo for his Ordinary Levels as his parents could not afford to pay his tuition fees. \r\n\r\nHenry Hunt had a shop in Wandegeya where coffee was ground and packed. It was the first of its kind in Uganda. He bought machines that did this and sold the coffee wholesale under the brand name, â€œKawa Kawomelaâ€. He marketed it across Uganda and it is no wonder his nick-name, â€œMwami Kawa Kawomelaâ€ came from. ',	'1359323659.jpg',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'2013-01-28 00:52:03',	4,	'2013-02-11 02:55:37',	4,	1),
