INSERT INTO `proverb` (`id`, `lugphrase`, `lugmeaning`, `engphrase`, `engmeaning`, `keywords`, `publish`, `datecreated`, `publishstart`, `publishend`) VALUES
(1,	'Abalamu magoma, gavugira aliwo.',	'Omuntu aganja ali ne banne. Bwavaawo nga bamwerabira.',	'Human beings are like drums, they only sound when one is present.',	'One can count on attention and favor when he or she is present. Once he or she departs, friends and colleagues will forget them.',	'',	1,	'2012-12-01 00:00:00',	'2012-11-19',	'2012-11-25'),
(2,	'Akabimbi akatono kakira ekyosi',	'Okukola n\'obaako wotuuse kisinga okwoosa. ',	'Digging a small part of the plot is better than not coming to dig at all.',	'Big goals can be achieved in small steps.  Any step towards your goals is better than doing nothing.',	'',	1,	'2012-12-01 00:00:00',	'2012-11-26',	'2012-12-02'),
(3,	'Amamese amangi, tegesimira bunnya.',	'Abantu abangi batera okulemwa okwegatta n\'okukola ku bintu eby\'okubayamba oba okubajja mu kabi.',	'Large numbers do not make rats better at digging holes to where they can escape enemies.',	'Involving too many people in dealing with a problem or danger often leads to disorganization and a poor solution.',	'',	1,	'2012-12-01 00:00:00',	'2012-12-03',	'2012-12-09'),
(4,	'Bugubugu, si muliro, essanja teriyiisa mmere.',	'Ekintu ekizibu tekyetaaga kukola ng\'oyanguyirira. Wabula kyetaaga okuweeba obudde obumala okukimaliriza.',	'Not all flames make a steady fire, dried banana leaves cannot be used to cook a meal.',	'Tough problems must not be handled in a rush. They require careful planning and adequate time.',	'',	1,	'2012-12-01 00:00:00',	'2012-12-10',	'2012-12-16'),
(5,	'Abomuvumu baba bakaaba, nga obuti baseka.',	'Omuntu omuvumu bwatakozesa magezi ayinza okuttibwa oba okugwa amangu mu bizibu.',	'When the relatives of the courageous one are crying, those of the coward are laughing.',	'Courage without intelligence and wisdom could easily lead to death or serious danger.',	'',	1,	'2012-12-01 00:00:00',	'2012-12-17',	'2012-12-23'),
(6,	'Ebibuuka bitalagaanye, bikubagana empawa.',	'Abantu okukolera awamu obulungi, basaana bamale kukkaanya ku ngeri gye banakwaatamu omulimu oba ensonga.',	'Birds that fly without coordination tend to run into each other.',	'For a several people to solve a problem well, it is best that they first agree on an implementation plan.',	'',	1,	'2012-12-01 00:00:00',	'2012-12-24',	'2012-12-30'),
(7,	'Gw\'omanyi enfumita tomulinda kugalula.',	'Omuntu gw\'omanyi nti wakabi, bwasunguwala osaana kumusegulira mangu. Oba, bwolaba obubonero obusooka nti enkintu eky\'omutawaana kijja, kikoleko oba kisegulire nga tekinasajjuka.',	'If you know how deadly his spear is when he uses it, never wait to see him raise it.',	'If you know someone one to  be dangerous, avoid him when he starts getting angry. Also, if you see the first signs of a dangerous situation developing, deal with it or get away before it becomes reality.',	'',	1,	'2012-12-01 00:00:00',	'2012-12-31',	'2013-01-06'),
(8,	'Kyerabirwa mugambi.',	'Bwogamba omuntu oba okumwogerako ekigambo ekibi oyinza okukyelabira naye ye takyelabira.',	'It is forgotten by the one who said it.',	'When you say unkind words to or about someone, you may forget it but he or she does not forget it.',	'',	1,	'2012-12-01 00:00:00',	'2013-01-07',	'2013-01-13'),
(9,	'Awakula ennume tewakula emu.',	'Omugezi oba omuzira ennyo bwavaawo, wabeelawo abala abamuddira mu bigere.',	'Where one bull grows, other bulls will grow.',	'When an exceptionally smart or courageous person leaves, others will surely come up to replace him or her.',	'',	1,	'2012-12-01 00:00:00',	'2013-01-14',	'2013-01-20'),
(10,	'Akasuka ly\'ali nalyo (effumu) taba muti.',	'Bwokola kyonna ky\'osobola mu mbeera gy\'olimu okutaasa banno oba okwetaasa, tosobola kuyitibwa muti.',	'The one who throws whatever he is holding (spear) is not a coward.',	'If you do what ever is humanly possible under the circumstances to save loved ones or yourself, you must never be called a coward.',	'',	1,	'2012-12-01 00:00:00',	'2013-01-21',	'2013-01-27'),
(11,	'Amaanyi ameemanye gamala ebita embuga.',	'Omuntu bwakozesa amaanyi oba obuyinza byokka, nga teyeegendereza na kuloowoza bulungi, ayonoona ebintu bingi.',	'Arrogant strength destroys the wine and beer containers in the chief\'s compound.',	'Strength or power without wisdom and careful thought can be destructive.',	'',	1,	'2012-12-01 00:00:00',	'2013-01-28',	'2013-02-03'),
(12,	'Gye baziregera si gye zivugira.',	'Okukubwa n\'empeewo bidiriza enngoma okuva ku ddoboozi kwe baba baaziregeera.  Ne mu kulamuza, omuntu aba takoze bubi okuyuusa mu kyayagala.',	'Drums are tuned at a higher tone than the intended normal sound.',	'Usage and the environment give drums a normal sound that is different from the one they have during tuning. Even in negotiations, it is reasonable to modify positions.',	'',	1,	'2012-12-01 00:00:00',	'2013-02-04',	'2013-02-10'),
(13,	'Akaganda akatono kakira omukwano.',	'Omukwano guyinza okufa era negutaddawo naye oluganda teruggwa ku mubiri.',	'A distant blood relationship is more sure than any friendship.',	'A friendship can be lost for ever but a blood relationship can never be erased.',	NULL,	1,	'2012-12-01 00:00:00',	'2013-02-11',	'2013-02-17'),
(14,	'Abumba akaza awulikikira wala.',	'Omuntu akola obulungi ebyetaagibwa amanyika mangu; teyeetaaga na kweranga.',	'A potter who dries his ware well can be heard of from afar.',	'A person who produces good and needed things easily becomes famous; he does not have to advertise himself.',	NULL,	1,	'2012-12-01 00:00:00',	'2013-02-18',	'2013-02-24'),
(15,	'Atunda ayolesa y\'atera okumaza.',	'Omutunzi atalaga bulungi by\'atunda tafuna mangu baguzi.',	'The seller who display his wares is then one who tends to run out.',	'A person who does not properly show  what he or she has to offer takes longer to get takers.',	NULL,	1,	'2012-12-01 00:00:00',	'2013-02-25',	'2013-03-03'),
(16,	'Awafa obuguzi tewafa mukwano.',	'Okulemwa okugulana n\'omuntu tekibatira mukwano.',	'Where a sales deal fails a friendship does not die.',	'Failure to reach agreement on a financial transaction with a friend must not affect your friendship.',	NULL,	1,	'2012-12-01 00:00:00',	'2013-03-04',	'2013-03-10'),
(17,	'Ennyongeza tetta buguzi.',	'Mu mpisa z\'Abaganda, omuguzi bw\'asaba okumwongeza ku bintu by\'aba agula, aba takoze bubi era tavunaanibwa.',	'Bargain must not kill a deal.',	'In Baganda culture, bargaining for a better deal is customary and anyone who does it is not at fault.',	NULL,	1,	'2012-12-01 00:00:00',	'2013-03-11',	'2013-03-17'),
(18,	'Omuwambi si muguzi.',	'Omuntu okwekwata obwekwasi ebintu nga tabisasulidde tekimuyisa muguzi.',	'Occupier does not mean buyer.',	'Taking possession of property with paying for it does not make you its rightful owner.',	NULL,	1,	'2012-12-01 00:00:00',	'2013-03-18',	'2013-03-24'),
(19,	'Ofunda n\'omuliika n\'anunula abaana.',	'Omuntu akujja mu kabi n\'akutwalako ensimbi ennyingi asinga oyo agaana okukuyamba  mu ngeri yonna.',	'It is alright to deal with someone who is expensive if he can save the children.',	'A person who charges  a high fee to get you out of danger is better than the one who refuses to help you at all.',	NULL,	1,	'2012-12-01 00:00:00',	'2013-03-25',	'2013-03-31'),
(20,	'Tebukozza (obwavu).',	'Omwavu bw\'aba nga mulamu ayinza okuba n\'emirembe era n\'ayirira.',	'It  (poverty) does not make one emaciated.',	'If a poor person has good health he or she can find peace and look good.',	NULL,	1,	'2012-12-01 00:00:00',	'2013-04-01',	'2013-04-07');
