('ejslavv06dgphkt6m60thjshs4',	1360863827,	3600,	'Default|a:15:{s:11:\"initialized\";b:1;s:6:\"errors\";s:0:\"\";s:14:\"successmessage\";s:0:\"\";s:10:\"formvalues\";a:0:{}s:6:\"userid\";s:1:\"4\";s:9:\"firstname\";s:7:\"Charles\";s:8:\"lastname\";s:6:\"Mukasa\";s:5:\"email\";s:18:\"csmukasa@gmail.com\";s:6:\"gender\";s:1:\"1\";s:8:\"personid\";s:3:\"107\";s:8:\"familyid\";s:2:\"10\";s:4:\"type\";s:1:\"2\";s:3:\"arq\";s:844:\"SELECT f.id, f.fatherid, f.motherid, pf.lastname as `Family Name`, \n	concat(pf.firstname, \' \', UPPER(pf.lastname), \' (\',pf.clanname,\')\') as `Father`, pf.gender as \'fathergender\', \n	concat(pm.firstname, \' \', UPPER(pm.lastname), \' (\',pm.clanname,\')\') as `Mother`, pm.gender as \'mothergender\' \n	FROM family f \n	LEFT JOIN person pf on (f.fatherid = pf.id ) \n	LEFT JOIN person pm on (f.motherid = pm.id) \n	LEFT JOIN person pff on (f.id = pff.familyid) \n	LEFT JOIN person pmm on (f.id = pmm.familyid) \n	WHERE f.id <> \'\' AND ((f.fatherid IS NOT NULL AND f.motherid IS NULL) OR (f.fatherid IS NULL AND f.motherid IS NOT NULL) OR (f.fatherid IS NOT NULL AND f.motherid IS NOT NULL))  AND (f.fatherid = \'107\' OR f.motherid = \'107\' OR f.addedbyid = \'107\' OR f.createdby = \'4\' OR pff.id = \'107\'  OR pmm.id = \'107\')  \n	GROUP BY f.id \n	ORDER BY pf.firstname \";s:3:\"crq\";s:857:\"SELECT f.id, f.fatherid, f.motherid, pf.lastname as `Family Name`, \n	concat(pf.firstname, \' \', UPPER(pf.lastname), \' (\',pf.clanname,\')\') as `Father`, pf.gender as \'fathergender\', \n	concat(pm.firstname, \' \', UPPER(pm.lastname), \' (\',pm.clanname,\')\') as `Mother`, pm.gender as \'mothergender\' \n	FROM family f \n	LEFT JOIN person pf on (f.fatherid = pf.id ) \n	LEFT JOIN person pm on (f.motherid = pm.id) \n	LEFT JOIN person pff on (f.id = pff.familyid) \n	LEFT JOIN person pmm on (f.id = pmm.familyid) \n	WHERE f.id <> \'\' AND ((f.fatherid IS NOT NULL AND f.motherid IS NULL) OR (f.fatherid IS NULL AND f.motherid IS NOT NULL) OR (f.fatherid IS NOT NULL AND f.motherid IS NOT NULL))  AND (f.fatherid = \'107\' OR f.motherid = \'107\' OR f.addedbyid = \'107\' OR f.createdby = \'4\' OR pff.id = \'107\'  OR pmm.id = \'107\')  \n	GROUP BY f.id \n	ORDER BY pf.firstname   LIMIT 0, 50\";s:23:\"list_query_stringfamily\";a:4:{s:10:\"controller\";s:6:\"family\";s:6:\"action\";s:4:\"list\";s:5:\"range\";s:1:\"2\";s:6:\"module\";s:7:\"default\";}}'),
